import React from "react";
const axios = require('axios');

const fetchBanks = async () => {
    try {
        const banks = await fetch('http://localhost:3001/fetchBanks', {
            method: 'GET',
        })
        console.log(banks)
        return banks
    } catch(e) {
        console.log("Couldn't fetch banks!" + e)
    }
}

export default fetchBanks
